import "./Main_components/Nav/NavBar.css";
import "./Main_components/Side/SideBar.css";
import "./Main_components/Acti/Activity.css";
import "./Main_components/post/Post.css";
import NavBar from "./Main_components/Nav/NavBar";
import SideBar from "./Main_components/Side/SideBar";
import Activity from "./Main_components/Acti/Activity";
import Post from "./Main_components/post/Post";



export default function App() {
  return (
    <div className="App">
    <NavBar />
    <SideBar />
    <Activity />
    <Post />
    </div>
  );

}
